import React from "react";
import { ImCancelCircle } from "react-icons/im";

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="head">
        <div className="logo">Unwrapped</div>
        <button>
          <ImCancelCircle />
        </button>
      </div>
    </div>
  );
};

export default Sidebar;
